        onKeyBoardLeft: '\n            var(tMaxHighLightNum,0)\n            var(okFlag,0)\n            set(tMaxHighLightNum,\'this.maxHighLightNum\')\n            set(okFlag,\'this.otherAttrs.1\')\n            if(tMaxHighLightNum>0){\n                if(okFlag==0){\n                    var(totalLayerNum,0)\n                    set(totalLayerNum,\'this.layers.length\')\n                    var(offset,0)\n                    var(tHighLightNum,0)\n                    //clear\n                    set(offset,\'this.otherAttrs.0\')\n                    while(offset < totalLayerNum){\n                        set(\'this.layers.offset.hidden\',1)\n                        add(offset,1)\n                    }\n                    //set target highlight\n                    set(offset,\'this.otherAttrs.0\')\n                    set(tHighLightNum,\'this.highLightNum\')\n                    add(offset,tHighLightNum)\n                    minus(offset,1)\n                    set(\'this.layers.offset.hidden\',0)   \n                }else{\n                    print(okFlag,\'ok mode\')\n                    var(tHighLightNum,0)\n                    var(tTag,0)\n                    var(tMode,0)\n                    var(xr,0)\n                    var(minusNum,0)\n                    set(minusNum,1)\n                    set(tHighLightNum,\'this.highLightNum\')\n                    getTag(tTag)\n                    set(tMode,\'this.mode\')\n                    if(tMode==1){\n                        if(tHighLightNum==1){\n                            set(xr,2)\n                        }else{\n                            set(xr,0)\n                        }\n                    }else{\n                        if(tHighLightNum==1){\n                            set(xr,4)\n                        }else{\n                            if(tHighLightNum==2){\n                                set(xr,2)\n                            }else{\n                                set(xr,0)\n                            }\n                        }\n                    }\n                    var(ttTag,0)\n                    var(txr,0)\n                    set(ttTag,tTag)\n                    set(txr,xr)\n                    while(xr>0){\n                        divide(ttTag,16)\n                        minus(xr,1)\n                    }\n                    mod(ttTag,16)\n                    var(rawttTag,0)\n                    set(rawttTag,ttTag)\n                    minus(ttTag,1)\n                    if(ttTag<0){\n                        set(ttTag,-7)\n                    }\n                    while(txr>0){\n                        multiply(ttTag,16)\n                        multiply(rawttTag,16)\n                        minus(txr,1)\n                    }\n                    minus(ttTag,rawttTag)\n                    add(tTag,ttTag)\n                    setTag(tTag)\n                }              \n            }\n        ',
